import 'blockchain-ui-privatization/PC/common-mixin/contract/index/index.styl';
import mixin from 'blockchain-ui-privatization/PC/common-mixin/contract/index/index';
import currentSymbol from '@/components/modules/spotTrade/contract/currentSymbol.vue';
import market from '@/components/modules/spotTrade/contract/market.vue';
import search from '@/components/modules/spotTrade/contract/search.vue'; // tradingView/ Echarts

import tradingView from '@/components/modules/spotTrade/contract/tradingView.vue'; // 盘口 & 实时成交

import Depth from '@/components/modules/spotTrade/contract/depth.vue'; // 下单交易

import tradeForm from '@/components/modules/spotTrade/contract/tradeForm.vue'; // 资产

import assets from '@/components/modules/coTrade/assets.vue'; // 订单列表

import orderList from '@/components/modules/spotTrade/contract/orderList.vue'; // 开通合约交易弹框

import openFutures from '@/components/modules/coTrade/component/openFutures.vue'; // 交易喜好设置弹框

import setFutures from '@/components/modules/coTrade/component/setFutures.vue'; // 计算器弹框

import calculator from '@/components/modules/coTrade/component/calculator.vue';
export default {
  mixins: [mixin],
  components: {
    currentSymbol: currentSymbol,
    search: search,
    market: market,
    tradingView: tradingView,
    Depth: Depth,
    tradeForm: tradeForm,
    assets: assets,
    orderList: orderList,
    openFutures: openFutures,
    setFutures: setFutures,
    calculator: calculator
  },
  data: function data() {
    return {
      activeExchange: 'futures',
      coinTabs: [{
        label: this.$t('pageTitle.spot'),
        value: 'spot'
      }, {
        label: this.$t('pageTitle.futures'),
        value: 'futures'
      }]
    };
  },
  mounted: function mounted() {
    this.init();
  },
  methods: {
    handlerChangeTab: function handlerChangeTab(item) {
      this.activeExchange = item.value;
      this.$emit('tabChange', item.value);
    }
  }
};
